          <Profile />
          <Route path='/' render={()=> <Profile/>}>
            {/* <Profile />
          </Route>
          <Route path='/about'>
            <About />
          </Route>
          <Route path='/chat'>
            <Chat /> */}
          </Route>
        </div>
      </div>
    </Router>
